import React from 'react';
import {Switch, Route} from 'react-router-dom';

import './App.css';
import Homepage from './pages/homepage/homepage.compnent';

const Hatspage =() => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Switch>
      <Route exact path='/' component={Homepage} />
      <Route path='/hats' component={Hatspage} />
      </Switch>
    </div>
  );
}

export default App;
